	this.frame_3 = function() {
		this.adteller = 0;
		this.hintlvlasked = 0;
		this.buttonhint.visible = false;
		this.buttonhintecht.visible = false;
		this.hintveld.hinttxt.text = "";
		this.hintveld.visible = false;
		this.buttonhintecht.cursor="pointer";
		this.hintveld.cursor="pointer";
		this.buttonhintecht.addEventListener("click", hintbuttonClickEvent);
		this.hintveld.addEventListener("click", hintveldClickEvent);
		this.quitscherm.visible = false;
		this.quitbutton.visible=true;
		this.quit.visible = true;
		this.quitbutton.cursor="pointer";
		this.quitbutton.addEventListener("click", quitbutton1ClickEvent);
		if (this.introskipped) {
			if (this.lvl==this.eerstegesplevel && this.musicon) this.mysong=createjs.Sound.play ("SongYellowMain",{interrupt: createjs.Sound.INTERRUPT_ANY,loop: -1});
		} else {
			if ((this.eerstegesplevel+1)==this.lvl && this.musicon) 
				this.mysong=createjs.Sound.play ("SongYellowMain",{interrupt: createjs.Sound.INTERRUPT_ANY,loop: -1});
		}
		
		
		this.buttonl1.visible=true;
		this.bar1.gotoAndStop(1);
		this.bar2.gotoAndStop(1);
		this.bar3.gotoAndStop(1);
		this.bar4.gotoAndStop(1);
		this.bar5.gotoAndStop(1);
		this.fader.gotoAndPlay(1);
		this.stop();
		stage.enableMouseOver(20);
		var sceneScherm=this;
		var frametel = 0;
		var buttontel = 0;
		this.buttonl1.cursor="pointer";
		this.buttonl1.addEventListener("click",onL1Button1ClickEvent);
		createjs.Ticker.addEventListener("tick",MainGameChecker1);
		
		function onL1Button1ClickEvent(e) {
			if (sceneScherm.musicon) createjs.Sound.play ("snd_tik");
			buttontel++;
			sceneScherm.buttonl1.gotoAndPlay(1);
			if (buttontel==1) sceneScherm.bar1.gotoAndPlay(2);
			else if (buttontel==2) sceneScherm.bar2.gotoAndPlay(2);
			else if (buttontel==3) sceneScherm.bar3.gotoAndPlay(2);
			else if (buttontel==4) sceneScherm.bar4.gotoAndPlay(2);
			else if (buttontel == 5) {
				sceneScherm.bar5.gotoAndPlay(2);
		
				sceneScherm.buttonl1.removeEventListener("click",onL1Button1ClickEvent);
				sceneScherm.buttonl1.visible=false;
				if (sceneScherm.musicon) createjs.Sound.play ("snd_oehoe");
				sceneScherm.quitbutton.visible=false;
				sceneScherm.quit.visible = false;
				sceneScherm.quitbutton.removeEventListener("click", quitbutton1ClickEvent);
				createjs.Ticker.removeEventListener("tick",MainGameChecker1);
				sceneScherm.buttonhintecht.removeEventListener("click", hintbuttonClickEvent);
				sceneScherm.hintveld.removeEventListener("click", hintveldClickEvent);
				pauzetel = 0; sceneScherm.lvl=2;
				
				if (sceneScherm.lvl>sceneScherm.hoogste) {
					sceneScherm.hoogste=sceneScherm.lvl;
					try {localStorage['thebluelevel']=sceneScherm.lvl} catch(err) {}			
				}
				
				createjs.Ticker.addEventListener("tick",EndLevel1Checker);
			}
		}
		
		function MainGameChecker1(e) {
			frametel++;
			if (frametel==1) {
				sceneScherm.buttonl1.visible=true;
				sceneScherm.bar1.gotoAndStop(1);
				sceneScherm.bar2.gotoAndStop(1);
				sceneScherm.bar3.gotoAndStop(1);
				sceneScherm.bar4.gotoAndStop(1);
				sceneScherm.bar5.gotoAndStop(1);
			}
			if (sceneScherm.adteller == sceneScherm.adinterval) {
				sceneScherm.buttonhint.visible = true;
				sceneScherm.buttonhintecht.visible = true;
			}
			sceneScherm.adteller++;
		}
		
		function EndLevel1Checker(e) {
			pauzetel++;
		//	if (pauzetel==1) {
		//		kongregate.stats.submit('LevelComplete',1);
		//	}
			if (pauzetel==30) {
				createjs.Ticker.removeEventListener("tick",EndLevel1Checker);
				sceneScherm.gotoAndStop("l2");
			}
		}
		
		function quitbutton1ClickEvent(e) {
			if (sceneScherm.musicon) createjs.Sound.play ("snd_tikstil");
			sceneScherm.quitscherm.visible = true;
			sceneScherm.quitscherm.back.addEventListener("click",dummy1ClickEvent);
			sceneScherm.quitscherm.buttonyes.cursor="pointer";
			sceneScherm.quitscherm.buttonno.cursor="pointer";
			sceneScherm.quitscherm.buttonyes.addEventListener("click",quityesbutton1ClickEvent);
			sceneScherm.quitscherm.buttonno.addEventListener("click",quitnobutton1ClickEvent);
		}
		function dummy1ClickEvent(e) {
		}
		function quityesbutton1ClickEvent(e) {
			sceneScherm.fromquit = true;
			if (sceneScherm.musicon) createjs.Sound.play ("snd_tikstil");
			sceneScherm.quitscherm.back.removeEventListener("click",dummy1ClickEvent);
			sceneScherm.quitscherm.buttonyes.removeEventListener("click",quityesbutton1ClickEvent);
			sceneScherm.quitscherm.buttonno.removeEventListener("click",quitnobutton1ClickEvent);
			sceneScherm.buttonhintecht.removeEventListener("click", hintbuttonClickEvent);
			sceneScherm.hintveld.removeEventListener("click", hintveldClickEvent);
		
			sceneScherm.buttonl1.removeEventListener("click",onL1Button1ClickEvent);
			sceneScherm.buttonl1.visible=false;
			sceneScherm.quitbutton.visible=false;
			sceneScherm.quit.visible = false;
			sceneScherm.quitbutton.removeEventListener("click", quitbutton1ClickEvent);
			createjs.Ticker.removeEventListener("tick",MainGameChecker1);
			
			sceneScherm.gotoAndStop("intro1");
		}
		function quitnobutton1ClickEvent(e){
			if (sceneScherm.musicon) createjs.Sound.play ("snd_tikstil");
			sceneScherm.quitscherm.back.removeEventListener("click",dummy1ClickEvent);
			sceneScherm.quitscherm.buttonyes.removeEventListener("click",quityesbutton1ClickEvent);
			sceneScherm.quitscherm.buttonno.removeEventListener("click",quitnobutton1ClickEvent);
			sceneScherm.quitscherm.visible = false;
		}
		function hintbuttonClickEvent(e) {
			if (sceneScherm.musicon) createjs.Sound.play ("snd_tikstil");
			sceneScherm.buttonhint.visible = false;
			sceneScherm.buttonhintecht.visible = false;
			sceneScherm.hintveld.visible = true;
			sceneScherm.hintveld.hinttxt.text = "";
			sceneScherm.hintlvlasked++;
			sceneScherm.hintindex = sceneScherm.hintlvlasked;
			while (sceneScherm.hintindex > sceneScherm.hints[sceneScherm.lvl - 1].length) {
				sceneScherm.hintindex -= sceneScherm.hints[sceneScherm.lvl - 1].length;
			}
			sceneScherm.hintveld.hinttxt.text = "HINT "+sceneScherm.hintindex+": "+ sceneScherm.hints[sceneScherm.lvl - 1][sceneScherm.hintindex-1];
			sceneScherm.adteller = sceneScherm.adinterval2;
		}
		function hintveldClickEvent(e) {
			if (sceneScherm.musicon) createjs.Sound.play ("snd_tikstil");
			sceneScherm.hintveld.visible = false;
			sceneScherm.adteller = sceneScherm.adinterval-2;
		}
	}
