			sceneScherm.fromquit = true;
			if (sceneScherm.musicon) createjs.Sound.play ("snd_tikstil");
			sceneScherm.quitscherm.back.removeEventListener("click",dummy14ClickEvent);
			sceneScherm.quitscherm.buttonyes.removeEventListener("click",quityesbutton14ClickEvent);
			sceneScherm.quitscherm.buttonno.removeEventListener("click",quitnobutton14ClickEvent);
			sceneScherm.buttonhintecht.removeEventListener("click", hintbuttonClickEvent);
